(window.webpackJsonp=window.webpackJsonp||[]).push([[9],{235:function(e){e.exports={data:{post:{title:"Markdown test file",path:"/markdown-test-file",date:"6. February 2019",timeToRead:6,tags:[{id:"Markdown",title:"Markdown",path:"/tag/markdown"},{id:"Test files",title:"Test files",path:"/tag/test-files"}],description:"Markdown is intended to be as easy-to-read and easy-to-write as is feasible. Readability, however, is emphasized above all else. A Markdown-formatted document should be publishable as-is, as plain text, without looking like it's been marked up with tags or formatting instructions.",content:'<p>Markdown is intended to be as easy-to-read and easy-to-write as is feasible.Readability, however, is emphasized above all else. A Markdown-formatted\ndocument should be publishable as-is, as plain text, without looking\nlike it\'s been marked up with tags or formatting instructions.</p>\n<p>While Markdown\'s syntax has been influenced by several existing text-to-HTML\nfilters -- including <a href="http://docutils.sourceforge.net/mirror/setext.html" target="_blank" rel="nofollow noopener noreferrer">Setext</a>, <a href="http://www.aaronsw.com/2002/atx/" target="_blank" rel="nofollow noopener noreferrer">atx</a>, <a href="http://textism.com/tools/textile/" target="_blank" rel="nofollow noopener noreferrer">Textile</a>, <a href="http://docutils.sourceforge.net/rst.html" target="_blank" rel="nofollow noopener noreferrer">reStructuredText</a>,\n<a href="http://www.triptico.com/software/grutatxt.html" target="_blank" rel="nofollow noopener noreferrer">Grutatext</a>, and <a href="http://ettext.taint.org/doc/" target="_blank" rel="nofollow noopener noreferrer">EtText</a> -- the single biggest source of\ninspiration for Markdown\'s syntax is the format of plain text email.</p>\n<h2 id="block-elements"><a href="#block-elements" aria-hidden="true"><span class="icon icon-link"></span></a>Block Elements</h2>\n<h3 id="paragraphs-and-line-breaks"><a href="#paragraphs-and-line-breaks" aria-hidden="true"><span class="icon icon-link"></span></a>Paragraphs and Line Breaks</h3>\n<p>A paragraph is simply one or more consecutive lines of text, separated\nby one or more blank lines. (A blank line is any line that looks like a\nblank line -- a line containing nothing but spaces or tabs is considered\nblank.) Normal paragraphs should not be indented with spaces or tabs.</p>\n<p>The implication of the "one or more consecutive lines of text" rule is\nthat Markdown supports "hard-wrapped" text paragraphs. This differs\nsignificantly from most other text-to-HTML formatters (including Movable\nType\'s "Convert Line Breaks" option) which translate every line break\ncharacter in a paragraph into a <code class="language-text">&lt;br /&gt;</code> tag.</p>\n<p>When you <em>do</em> want to insert a <code class="language-text">&lt;br /&gt;</code> break tag using Markdown, you\nend a line with two or more spaces, then type return.</p>\n<h3 id="headers"><a href="#headers" aria-hidden="true"><span class="icon icon-link"></span></a>Headers</h3>\n<p>Markdown supports two styles of headers, [Setext][1] and [atx][2].</p>\n<p>Optionally, you may "close" atx-style headers. This is purely\ncosmetic -- you can use this if you think it looks better. The\nclosing hashes don\'t even need to match the number of hashes\nused to open the header. (The number of opening hashes\ndetermines the header level.)</p>\n<h3 id="images"><a href="#images" aria-hidden="true"><span class="icon icon-link"></span></a>Images</h3>\n<p>Images are added with <code class="language-text">![Image Alt](./images/image.jpg)</code></p>\n<p><img class="g-image g-image--lazy g-image--loading" src="data:image/svg+xml,%3csvg fill=\'none\' viewBox=\'0 0 1920 1278\' xmlns=\'http://www.w3.org/2000/svg\' xmlns:xlink=\'http://www.w3.org/1999/xlink\'%3e%3cdefs%3e%3cfilter id=\'__svg-blur-0\'%3e%3cfeGaussianBlur in=\'SourceGraphic\' stdDeviation=\'40\'/%3e%3c/filter%3e%3c/defs%3e%3cimage x=\'0\' y=\'0\' filter=\'url(%23__svg-blur-0)\' width=\'1920\' height=\'1278\' xlink:href=\'data:image/jpeg%3bbase64%%2bmMkpzYHHkrWOjLjwW/T4YXW0KqICkF1QNpnHkpm0jjyK6ymwVzrek9la0%2bXXOt6fC3LuUcXnoFwbaFx/KVM3D3HkiVT5Ve4CzPCsqfJz3fppg6PuldHJ2QwpaBwI0KsoaFxtoUToMlv0%2b6PZbTcpGMXMZ7Ls2eNu6lfDIdkJ4jJCLy09OOl5bK1p56psbXR4dCb8CXnVcTDjdRC68Lgx37mtF%2b6yfGqyYWqKmd46OkJ8K0sp/aow%2bsHR9kQY8VxGIgihpAPc/6p34/i7HNcWU1O1pvpZo%\' /%3e%3c/svg%3e" width="1920" alt="Image" data-srcset="/gridsome-bulma/assets/static/alexandr-podvalny-220262-unsplash.82a2fbd.4903438.jpg 480w, /gridsome-bulma/assets/static/alexandr-podvalny-220262-unsplash.cbab2cf.4903438.jpg 1024w, /gridsome-bulma/assets/static/alexandr-podvalny-220262-unsplash.2665e34.4903438.jpg 1920w" data-sizes="(max-width: 1920px) 100vw, 1920px" data-src="/gridsome-bulma/assets/static/alexandr-podvalny-220262-unsplash.2665e34.4903438.jpg"><noscript><img class="g-image g-image--lazy g-image--loaded" src="/gridsome-bulma/assets/static/alexandr-podvalny-220262-unsplash.2665e34.4903438.jpg" width="1920" alt="Image"></noscript></p>\n<h3 id="blockquotes"><a href="#blockquotes" aria-hidden="true"><span class="icon icon-link"></span></a>Blockquotes</h3>\n<p>Markdown uses email-style <code class="language-text">&gt;</code> characters for blockquoting. If you\'re\nfamiliar with quoting passages of text in an email message, then you\nknow how to create a blockquote in Markdown. It looks best if you hard\nwrap the text and put a <code class="language-text">&gt;</code> before every line:</p>\n<blockquote>\n<p>This is a blockquote with two paragraphs. Lorem ipsum dolor sit amet,\nconsectetuer adipiscing elit. Aliquam hendrerit mi posuere lectus.\nVestibulum enim wisi, viverra nec, fringilla in, laoreet vitae, risus.</p>\n<p>Donec sit amet nisl. Aliquam semper ipsum sit amet velit. Suspendisse\nid sem consectetuer libero luctus adipiscing.</p>\n</blockquote>\n<p>Markdown allows you to be lazy and only put the <code class="language-text">&gt;</code> before the first\nline of a hard-wrapped paragraph:</p>\n<blockquote>\n<p>This is a blockquote with two paragraphs. Lorem ipsum dolor sit amet,\nconsectetuer adipiscing elit. Aliquam hendrerit mi posuere lectus.\nVestibulum enim wisi, viverra nec, fringilla in, laoreet vitae, risus.</p>\n<p>Donec sit amet nisl. Aliquam semper ipsum sit amet velit. Suspendisse\nid sem consectetuer libero luctus adipiscing.</p>\n</blockquote>\n<p>Blockquotes can be nested (i.e. a blockquote-in-a-blockquote) by\nadding additional levels of <code class="language-text">&gt;</code>:</p>\n<blockquote>\n<p>This is the first level of quoting.</p>\n<blockquote>\n<p>This is nested blockquote.</p>\n</blockquote>\n<p>Back to the first level.</p>\n</blockquote>\n<p>Blockquotes can contain other Markdown elements, including headers, lists,\nand code blocks:</p>\n<blockquote>\n<h2 id="this-is-a-header"><a href="#this-is-a-header" aria-hidden="true"><span class="icon icon-link"></span></a>This is a header.</h2>\n<ol>\n<li>This is the first list item.</li>\n<li>This is the second list item.</li>\n</ol>\n<p>Here\'s some example code:</p>\n<pre class="language-text">return shell_exec(&quot;echo $input | $markdown_script&quot;);</pre>\n</blockquote>\n<p>Any decent text editor should make email-style quoting easy. For\nexample, with BBEdit, you can make a selection and choose Increase\nQuote Level from the Text menu.</p>\n<h3 id="lists"><a href="#lists" aria-hidden="true"><span class="icon icon-link"></span></a>Lists</h3>\n<p>Markdown supports ordered (numbered) and unordered (bulleted) lists.</p>\n<p>Unordered lists use asterisks, pluses, and hyphens -- interchangably\n-- as list markers:</p>\n<ul>\n<li>Red</li>\n<li>Green</li>\n<li>Blue</li>\n</ul>\n<p>is equivalent to:</p>\n<ul>\n<li>Red</li>\n<li>Green</li>\n<li>Blue</li>\n</ul>\n<p>and:</p>\n<ul>\n<li>Red</li>\n<li>Green</li>\n<li>Blue</li>\n</ul>\n<p>Ordered lists use numbers followed by periods:</p>\n<ol>\n<li>Bird</li>\n<li>McHale</li>\n<li>Parish</li>\n</ol>\n<p>It\'s important to note that the actual numbers you use to mark the\nlist have no effect on the HTML output Markdown produces. The HTML\nMarkdown produces from the above list is:</p>\n<p>If you instead wrote the list in Markdown like this:</p>\n<ol>\n<li>Bird</li>\n<li>McHale</li>\n<li>Parish</li>\n</ol>\n<p>or even:</p>\n<ol start="3">\n<li>Bird</li>\n<li>McHale</li>\n<li>Parish</li>\n</ol>\n<p>you\'d get the exact same HTML output. The point is, if you want to,\nyou can use ordinal numbers in your ordered Markdown lists, so that\nthe numbers in your source match the numbers in your published HTML.\nBut if you want to be lazy, you don\'t have to.</p>\n<p>To make lists look nice, you can wrap items with hanging indents:</p>\n<ul>\n<li>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.\nAliquam hendrerit mi posuere lectus. Vestibulum enim wisi,\nviverra nec, fringilla in, laoreet vitae, risus.</li>\n<li>Donec sit amet nisl. Aliquam semper ipsum sit amet velit.\nSuspendisse id sem consectetuer libero luctus adipiscing.</li>\n</ul>\n<p>But if you want to be lazy, you don\'t have to:</p>\n<ul>\n<li>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.\nAliquam hendrerit mi posuere lectus. Vestibulum enim wisi,\nviverra nec, fringilla in, laoreet vitae, risus.</li>\n<li>Donec sit amet nisl. Aliquam semper ipsum sit amet velit.\nSuspendisse id sem consectetuer libero luctus adipiscing.</li>\n</ul>\n<p>List items may consist of multiple paragraphs. Each subsequent\nparagraph in a list item must be indented by either 4 spaces\nor one tab:</p>\n<ol>\n<li>\n<p>This is a list item with two paragraphs. Lorem ipsum dolor\nsit amet, consectetuer adipiscing elit. Aliquam hendrerit\nmi posuere lectus.</p>\n<p>Vestibulum enim wisi, viverra nec, fringilla in, laoreet\nvitae, risus. Donec sit amet nisl. Aliquam semper ipsum\nsit amet velit.</p>\n</li>\n<li>Suspendisse id sem consectetuer libero luctus adipiscing.</li>\n</ol>\n<p>It looks nice if you indent every line of the subsequent\nparagraphs, but here again, Markdown will allow you to be\nlazy:</p>\n<ul>\n<li>\n<p>This is a list item with two paragraphs.</p>\n<pre class="language-text">This is the second paragraph in the list item. You&#39;re</pre>\n<p>only required to indent the first line. Lorem ipsum dolor\nsit amet, consectetuer adipiscing elit.</p>\n</li>\n<li>Another item in the same list.</li>\n</ul>\n<p>To put a blockquote within a list item, the blockquote\'s <code class="language-text">&gt;</code>\ndelimiters need to be indented:</p>\n<ul>\n<li>\n<p>A list item with a blockquote:</p>\n<blockquote>\n<p>This is a blockquote\ninside a list item.</p>\n</blockquote>\n</li>\n</ul>\n<p>To put a code block within a list item, the code block needs\nto be indented <em>twice</em> -- 8 spaces or two tabs:</p>\n<ul>\n<li>\n<p>A list item with a code block:</p>\n<pre class="language-text">&lt;code goes here&gt;</pre>\n</li>\n</ul>\n<h3 id="code-blocks"><a href="#code-blocks" aria-hidden="true"><span class="icon icon-link"></span></a>Code Blocks</h3>\n<p>Pre-formatted code blocks are used for writing about programming or\nmarkup source code. Rather than forming normal paragraphs, the lines\nof a code block are interpreted literally. Markdown wraps a code block\nin both <code class="language-text">&lt;pre&gt;</code> and <code class="language-text">&lt;code&gt;</code> tags.</p>\n<p>To produce a code block in Markdown, simply indent every line of the\nblock by at least 4 spaces or 1 tab.</p>\n<p>This is a normal paragraph:</p>\n<pre class="language-text">This is a code block.</pre>\n<p>Here is an example of AppleScript:</p>\n<pre class="language-text">tell application &quot;Foo&quot;\n    beep\nend tell</pre>\n<p>A code block continues until it reaches a line that is not indented\n(or the end of the article).</p>\n<p>Within a code block, ampersands (<code class="language-text">&amp;</code>) and angle brackets (<code class="language-text">&lt;</code> and <code class="language-text">&gt;</code>)\nare automatically converted into HTML entities. This makes it very\neasy to include example HTML source code using Markdown -- just paste\nit and indent it, and Markdown will handle the hassle of encoding the\nampersands and angle brackets. For example, this:</p>\n<pre class="language-text">&lt;div class=&quot;footer&quot;&gt;\n    &amp;copy; 2004 Foo Corporation\n&lt;/div&gt;</pre>\n<p>Regular Markdown syntax is not processed within code blocks. E.g.,\nasterisks are just literal asterisks within a code block. This means\nit\'s also easy to use Markdown to write about Markdown\'s own syntax.</p>\n<pre class="language-text">tell application &quot;Foo&quot;\n    beep\nend tell</pre>\n<h2 id="span-elements"><a href="#span-elements" aria-hidden="true"><span class="icon icon-link"></span></a>Span Elements</h2>\n<h3 id="links"><a href="#links" aria-hidden="true"><span class="icon icon-link"></span></a>Links</h3>\n<p>Markdown supports two style of links: <em>inline</em> and <em>reference</em>.</p>\n<p>In both styles, the link text is delimited by [square brackets].</p>\n<p>To create an inline link, use a set of regular parentheses immediately\nafter the link text\'s closing square bracket. Inside the parentheses,\nput the URL where you want the link to point, along with an <em>optional</em>\ntitle for the link, surrounded in quotes. For example:</p>\n<p>This is <a href="http://example.com/" target="_blank" rel="nofollow noopener noreferrer">an example</a> inline link.</p>\n<p><a href="http://example.net/" target="_blank" rel="nofollow noopener noreferrer">This link</a> has no title attribute.</p>\n<h3 id="emphasis"><a href="#emphasis" aria-hidden="true"><span class="icon icon-link"></span></a>Emphasis</h3>\n<p>Markdown treats asterisks (<code class="language-text">*</code>) and underscores (<code class="language-text">_</code>) as indicators of\nemphasis. Text wrapped with one <code class="language-text">*</code> or <code class="language-text">_</code> will be wrapped with an\nHTML <code class="language-text">&lt;em&gt;</code> tag; double <code class="language-text">*</code>\'s or <code class="language-text">_</code>\'s will be wrapped with an HTML\n<code class="language-text">&lt;strong&gt;</code> tag. E.g., this input:</p>\n<p><em>single asterisks</em></p>\n<p><em>single underscores</em></p>\n<p><strong>double asterisks</strong></p>\n<p><strong>double underscores</strong></p>\n<h3 id="code"><a href="#code" aria-hidden="true"><span class="icon icon-link"></span></a>Code</h3>\n<p>To indicate a span of code, wrap it with backtick quotes (<code class="language-text">`</code>).\nUnlike a pre-formatted code block, a code span indicates code within a\nnormal paragraph. For example:</p>\n<p>Use the <code class="language-text">printf()</code> function.</p>\n',coverImage:null}}}}}]);